def sortArray(array): 
    for i in range(len(array)): 

        for j in range(i+1, len(array)): 
            if array[i] > array[j]:                                              
                array[i], array[j] = array[j], array[i] 
    return array

print(sortArray([5, 2, 8, 10, 1, 4]))

Output: [1, 2, 4, 5, 8, 10]

