具体的产品信息和申请流程请咨询当地银行或者官方客服了解。

很抱歉听到您的微粒贷绑定的银行卡丢失了。在这种情况下，您需要尽快联系银行并申请补发新卡。一旦新卡收到并且激活后，您可以按照以下步骤重新绑定微粒贷：

1. 登录到您的微粒贷账户;
2. 在“我的贷款”页面中找到已绑定的银行卡信息;
3. 点击银行卡信息进入详情页;
4. 选择“解绑”;
5. 输入支付密码以确认操作;
6. 返回主界面，再次点击“添加银行卡”按钮;
7. 根据提示填写新的银行卡信息并完成绑定。

请注意，如果您之前已经通过实名认证和身份验证，那么在新卡绑定成功后，系统会自动将之前的欠款转移至新卡上。同时，为了确保资金安全，建议您及时修改微粒贷的支付密码。

逾期费用。若您在申请微粒贷过程中遇到问题，可以通过以下方式解决：
1、如果在借款过程中，您无法选择或使用微粒贷，请尝试清除浏览器缓存或者登录页面切换至不同浏览器进行尝试;
2、如遇账户问题，请您不要相信除官方渠道以外的不良借贷app和平台，谨防上当受骗。

